import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
//import App from './App';
import Card from "./Cards";
import Home from "./Home/Home";

import {BrowserRouter} from "react-router-dom";

  function ncard(val){

   return(
      <Card  imgsrc={val.imgsrc}
        sname={val.sname}
       title={val.title}
      
       link={val.link}
/>
   );
  }
       
ReactDOM.render(
<BrowserRouter>
<Home/>
</BrowserRouter>
,
document.getElementById("root")
);
